(2548, 15, NULL, 'জনাব তামজিদ শাহরিয়ার জামান ভূষন', 'মোঃ নুরু জ্জামান', 'ফেরদৌসী সুলতানা', '০১নং ষ্টাফ কোয়াটার, জয় পাহাড় এস্টেট, জামাল খান, চট্টগ্রাম। ', 'গ্রাম- মধ্যম ধলিয়া, পোষ্ট- বালুয়া, থানা- ফেনী সদর, জেলা- ফেনী। ', 'এইচ.এস.সি', NULL, NULL, NULL, NULL, NULL, NULL, 1);
